import { baseURL } from "./OpenAI";
import React from "react";
import axios from "axios";

class OpenAINLP extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            urlBase: baseURL,
            openAIresponse: {
                petNames: [],
                petSpecie: '',
            },
        };
    }

    GetPetNames(specieInput) {
        this.state.petSpecie = specieInput;
        axios
         .post(this.state.urlBase + "nlp-pet-name/specie/" + this.state.petSpecie)
         .then((response) => {
            this.state.openAIresponse.petNames = response.data.names;
            this.state.openAIrespons.petSpecie = response.data.specie;
         })
         .catch((error) => {
            console.log(error);
         });

         return this.state.openAIrespons;
    }
}
export default OpenAINLP;
